  const { value = [], onChange, min = 1, max = 5 } = props

  const onAdd = i => {
    const newValue = cloneDeep(value)
    newValue.splice(i + 1, 0, '')
    onChange(newValue)
  }

  const onRemove = i => {
    const newValue = cloneDeep(value)
    newValue.splice(i, 1)
    onChange(newValue)
  }

